import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const UserProduct = ({product}) => {
  return (
    <Link className="productCard" to={product._id}>
      <p>
        {product.name }
      </p>
      <span>
        {product}
      </span>
    </Link>


  );
};
export default UserProduct;
